webpackJsonp([28226720108805],{786:function(A,a){A.exports={data:{markdownRemark:{headings:[],html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 71.45%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Yokko Mobile Application"\n        title=""\n        src="/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-35578.jpg"\n        srcset="/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-21994.jpg 375w,\n/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-f7c9d.jpg 750w,\n/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-35578.jpg 1500w,\n/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-5ea4e.jpg 2000w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The connection between a mother and a baby begins from the moment of conception.  With the mobile application Yokko, women are able to better connect with their children throughout their journey as one. The application is designed to track the baby’s size, weight,  heart rate, movement, and positioning.  A wearable strap accompanies the application to ensure the data is personalized.  This data is then visualized via the image of an egg - as the baby develops, so does the imagery.  Yokko enables parents carefully monitor their baby’s development without having to leverage medical personnel. In addition, if complications do occur, Yokko can help those expecting discover complications sooner and action them more readily. Yokko is available on both mobile and watch applications.</p>',frontmatter:{title:"Yokko",graduate:"Sarah Keast",category:"Product Design",category2:"UI/UX",category3:null,image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-a7a62.jpg",srcSet:"/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-5a1a9.jpg 375w,\n/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-0908c.jpg 750w,\n/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-a7a62.jpg 1500w,\n/static/sarahkeast-yokko1-326321f046034b75c509e2858e9d3b95-83d7d.jpg 2000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}}},pathContext:{slug:"/work/yokko/",name:"/Yokko/"}}}});
